import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { AiFillCaretRight, AiFillCaretLeft } from "react-icons/ai";
import { BsCaretUpFill, BsCaretDownFill } from "react-icons/bs";

import "./App.css";

import Slider from "react-slick";
import { useEffect, useState, useRef } from "react";
function App() {
  const [nav1, setNav1] = useState();
  const [nav2, setNav2] = useState();
  const slider1 = useRef(null);
  const slider2 = useRef(null);

  useEffect(() => {
    setNav1(slider1.current);
    setNav2(slider2.current);
  }, []);

  const PrevArrowVertical = (props) => {
    const { onClick, currentSlide } = props;
    return (
      <button onClick={onClick} className="prevIconVertical">
        <BsCaretUpFill
          style={{ width: "100%", height: "100%", cursor: "pointer" }}
        />
      </button>
    );
  };

  const NextArrowVertical = (props) => {
    const { onClick, slideCount, currentSlide } = props;
    return (
      <button onClick={onClick} className="nextIconVertical">
        <BsCaretDownFill
          style={{ width: "100%", height: "100%", cursor: "pointer" }}
        />
      </button>
    );
  };

  const PrevArrowHorizontal = (props) => {
    const { onClick, currentSlide } = props;
    return (
      <button onClick={onClick} className="prevIconHorizontal">
        <AiFillCaretRight
          style={{ width: "100%", height: "100%", cursor: "pointer" }}
        />
      </button>
    );
  };

  const NextArrowHorizontal = (props) => {
    const { onClick, slideCount, currentSlide } = props;
    return (
      <button onClick={onClick} className="nextIconHorizontal">
        <AiFillCaretLeft
          style={{ width: "100%", height: "100%", cursor: "pointer" }}
        />
      </button>
    );
  };

  const newSettings = {
    asNavFor: nav2,
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <NextArrowHorizontal />,
    prevArrow: <PrevArrowHorizontal />,
  };

  const settings = {
    asNavFor: nav1,
    dots: false,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    vertical: true,
    verticalSwiping: true,
    swipeToSlide: true,
    nextArrow: <NextArrowVertical />,
    prevArrow: <PrevArrowVertical />,
  };

  const DATA = [
    {
      id: 1,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 2,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 3,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 4,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 5,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 6,
      image:
        "data:image/jpeg;base64,",
    },
  ];
  return (
    <div className="main-container">
      <div className="slider-right-side">
        <Slider className="verticalSlider" {...settings} ref={slider2}>
          {DATA.map((data, index) => {
            return (
              <div key={index}>
                <img src={data.image} alt="image" />
              </div>
            );
          })}
        </Slider>
      </div>

      <div className="slider-left-side">
        <Slider {...newSettings} ref={slider1} className='horizontalSlider'>
        {DATA.map((data, index) => {
            return (
              <div>

                <img src={data.image} alt="image" className='imageClass' key={index} />
              </div>
            );
          })}
        </Slider>
      </div>
    </div>
  );
}

export default App;
